    else{
      setMode('light');
    }
  }
  return (
    <>   
    <Navbar title="Textutils2" aboutText="About Textutils" mode={mode} toogleMode={toggleMode}/>
    {/* <Navbar/> */}
    {/* <Alert alert="This is an alert"/> */}
    <div className="container my-3">
    <TextForm heading="Analyze your text below"></TextForm>
    </div>
    {/* <About/> */}
    </>
  );
} 

export default App;
